package model.bean;

public class Nam {
	private int id;
	private String nam;
	
	public Nam() {
		// TODO Auto-generated constructor stub
	}

	public Nam(int id, String nam) {
		super();
		this.id = id;
		this.nam = nam;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public String getNam() {
		return nam;
	}

	public void setNam(String nam) {
		this.nam = nam;
	}
	
	
}
